Information
------------------------------

Conspiracy: Series 1 
Documentary strand putting accepted versions of historical events under the microscope and getting to grips with conspiracy theories associated with the topics.


1)  Hitlers Death 
The first edition looks at unusual beliefs concerning the Nazis, including the idea that Adolf Hitler escaped death in 1945 and left the corpse of a double behind to fool the rest of the world. Plus, theories surrounding the whereabouts of gold looted by the Nazis and never seen again.

2)  The Nazi King 
Despite the royal family changing its name from Saxe-Coburg-Gotha to Windsor, many conspiracy theorists believe its allegiances remained firmly with Germany, claiming Edward VIII was a Nazi sympathiser, while his brother George tried to negotiate a secret peace treaty with Rudolf Hess. Such suggestions are scrutinised by this part-dramatised documentary, alongside claims that Princess Margaret had a love child and that the family may have had a hand in the incident that led to the death of Diana, Princess of Wales.

3)  Cold War Files 
Documentary exploring popular conspiracy theories surrounding the Cold War, including how the lies of one man, former head of intelligence for the German army Reinhard Gehlen, moved the world to within hours of nuclear destruction. Theories related to the potential devastation of the 1962 Cuban Missile Crisis are also examined, along with suspicions associated with the assassination of Italy's former Prime Minister Aldo Morro, who some claim was killed not by communist revolutionists but by a sinister underground army created by Nato.

4)  Lord Lucan Dossier 
The case of John Bingham, 7th Earl of Lucan, who disappeared in November 1974, coinciding with the murder of his children's nanny Sandra Rivett. Lucan was never caught or tried for the crime, but in the four decades since he fled numerous sightings have been reported of him from around the world. Some people believe he escaped justice, while others think he too was later murdered. Other cases considered include the kidnapping and murder of aviator Charles Lindbergh's baby son in 1927 and the disappearance of American union leader Jimmy Hoffa in an act some people claim was a mob-sanctioned hit.

5)  The Hollywood Files 
Documentary examining common conspiracy theories surrounding Hollywood crimes. The 2014 hacking of Sony pictures is widely regarded as a revenge attack by North Korea for satirical film The Interview, but some suggest a marketing ruse to boost ailing box-office takings as a more likely explanation. Plus, a retired member of the police department names his own father a probable murderer, and there are musings about the Church of Scientology's possible involvement in the deaths of celebrities.

6)  Alien Cover Up 
Documentary exploring conspiracy theories regarding extraterrestrial contact, including the so-called `British Roswell' case of 1979, when forester Robert Taylor returned home battered and bruised after a walk through woods in West Lothian. Insistent he had been kidnapped by a `dark sphere', his case remains the only alleged alien abduction to have been investigated by police. Plus, claims that staff at the European Space Agency have been communicating with otherworldly beings on board a spacecraft for the past 20 years.

